INSERT INTO `dossier` VALUES (1,'INTERPOL DOSSIER\r\n\r\nSUBJECT: Walter White\r\n\r\nPERSONAL INFORMATION:\r\n\r\nFull Name: Walter Hartwell White\r\nAlias: Heisenberg\r\nDate of Birth: September 7, 1959\r\nPlace of Birth: Albuquerque, New Mexico, USA\r\nNationality: American\r\n\r\nPHYSICAL DESCRIPTION:\r\n\r\nHeight: 5\'10\" (178 cm)\r\nBuild: Average\r\nHair Color: Brown (shaved bald during criminal activities)\r\nEye Color: Blue\r\n\r\nBACKGROUND:\r\n\r\nWalter White was a high school chemistry teacher turned methamphetamine manufacturer and drug lord. Born and raised in Albuquerque, New Mexico, he led a seemingly ordinary life until circumstances led him to enter the criminal underworld.\r\n\r\nCRIMINAL ACTIVITIES:\r\n\r\nMethamphetamine Production and Distribution:\r\nWalter White was involved in the large-scale production and distribution of methamphetamine. Using his extensive knowledge of chemistry, he partnered with Jesse Pinkman, a former student, to create a highly pure and sought-after blue methamphetamine product.\r\n\r\nDrug Trafficking:\r\nAs a prominent figure in the drug trade, Walter White orchestrated the distribution of methamphetamine on a regional and national level. He established a network of dealers and associates to expand his criminal enterprise.\r\n\r\nViolence and Murders:\r\nThroughout his criminal activities, Walter White resorted to violence to protect his interests and eliminate threats. He orchestrated acts of violence, including bombings, shootings, and poisonings, to maintain control and eliminate rivals.\r\n\r\nMoney Laundering:\r\nTo conceal the proceeds from his illegal activities, Walter White engaged in money laundering operations. He used various fronts, including car wash businesses and shell companies, to legitimize and integrate illicit funds into the legal economy.\r\n\r\nKNOWN ASSOCIATES:\r\n\r\nJesse Pinkman:\r\nWalter White formed a partnership with Jesse Pinkman, a small-time methamphetamine producer and dealer. Together, they built a highly successful methamphetamine empire, but their relationship became increasingly strained as their ambitions and personal conflicts clashed.\r\n\r\nSaul Goodman:\r\nWalter White sought legal advice and representation from Saul Goodman, a criminal lawyer known for his unorthodox tactics. Saul assisted Walter in navigating the legal and criminal landscapes, providing advice on money laundering and protecting his interests.\r\n\r\nLEGAL TROUBLES:\r\n\r\nWalter White managed to evade significant legal scrutiny for a considerable duration of his criminal activities. However, as his empire grew and law enforcement agencies became aware of his presence, he faced increasing investigations and law enforcement pressure.\r\n\r\nCONCLUSION:\r\n\r\nWalter White, once a respected chemistry teacher, transformed into a ruthless and highly influential figure in the criminal underworld. His involvement in methamphetamine production, drug trafficking, violence, and money laundering established him as a significant player in the illicit drug trade. His actions had far-reaching consequences, impacting the lives of those around him and leaving a trail of destruction in his wake.'),(2,'INTERPOL DOSSIER\r\n\r\nSUBJECT: Gustavo Fring\r\n\r\nPERSONAL INFORMATION:\r\n\r\nFull Name: Gustavo Fring\r\nAlias: Gus\r\nDate of Birth: 1958-02-06\r\nPlace of Birth: Chile\r\nNationality: Chilean (naturalized American citizen)\r\n\r\nPHYSICAL DESCRIPTION:\r\n\r\nHeight: 5\'10\" (178 cm)\r\nBuild: Average\r\nHair Color: Black\r\nEye Color: Brown\r\n\r\nBACKGROUND:\r\n\r\nGustavo Fring was a prominent figure in the illicit drug trade, known for his highly organized operations and seemingly legitimate business enterprises. Little is known about his personal life or background, but he hailed from Chile before immigrating to the United States.\r\n\r\nCRIMINAL ACTIVITIES:\r\n\r\nMethamphetamine Production and Distribution:\r\nGustavo Fring oversaw a large-scale methamphetamine production and distribution network. He maintained a reputation for producing high-quality blue methamphetamine, surpassing competitors in both purity and consistency.\r\n\r\nDrug Trafficking:\r\nFring had extensive involvement in drug trafficking, using his network of connections to distribute methamphetamine across various regions. He established partnerships with other criminal organizations to expand his reach and maintain control over the drug market.\r\n\r\nMoney Laundering:\r\nTo legitimize his illicit earnings, Gustavo Fring engaged in sophisticated money laundering schemes. He used legitimate businesses, such as the fast-food chain Los Pollos Hermanos, to launder the proceeds from his drug operations, making it challenging to trace the origins of his wealth.\r\n\r\nViolence and Assassinations:\r\nGus Fring was known for his calculated and ruthless nature. He utilized violence as a means to protect his interests, eliminate rivals, and maintain control over his criminal empire. His involvement in assassinations, bombings, and other acts of violence demonstrated his willingness to ensure the success of his operations.\r\n\r\nKNOWN ASSOCIATES:\r\n\r\nMike Ehrmantraut:\r\nGustavo Fring employed Mike Ehrmantraut as his trusted enforcer and right-hand man. Mike played a crucial role in overseeing security, logistics, and enforcement within Fring\'s operations.\r\n\r\nWalter White and Jesse Pinkman:\r\nGus Fring entered into a partnership with Walter White and Jesse Pinkman, utilizing their chemistry skills to produce high-quality methamphetamine. However, their relationship became strained as conflicts of interest arose.\r\n\r\nLEGAL TROUBLES:\r\n\r\nGustavo Fring managed to maintain a low profile and avoid significant legal repercussions for an extended period. His ability to operate discreetly and blend illegal activities with legitimate businesses made it difficult for law enforcement agencies to gather substantial evidence against him.\r\n\r\nCONCLUSION:\r\n\r\nGustavo Fring was a highly influential figure in the illicit drug trade, known for his meticulous planning, organizational skills, and calculated approach to criminal activities. His involvement in methamphetamine production, drug trafficking, money laundering, and acts of violence solidified his status as a major player in the criminal underworld.'),(3,'INTERPOL DOSSIER\r\n\r\nSUBJECT: Mike Ehrmantraut\r\n\r\nPERSONAL INFORMATION:\r\n\r\nFull Name: Michael Ehrmantraut\r\nAlias: Mike\r\nDate of Birth: 09/11/1954\r\nPlace of Birth: Unknown\r\nNationality: American\r\n\r\nPHYSICAL DESCRIPTION:\r\n\r\nHeight: 6\'2\" (188 cm)\r\nBuild: Muscular\r\nHair Color: Graying Brown\r\nEye Color: Blue\r\n\r\nBACKGROUND:\r\n\r\nMike Ehrmantraut was a former police officer turned private investigator and enforcer. Details about his personal life and background remain undisclosed, making it challenging to obtain accurate information regarding his origins.\r\n\r\nCRIMINAL ASSOCIATIONS:\r\n\r\nEnforcer for Gustavo Fring:\r\nMike Ehrmantraut served as the trusted enforcer and right-hand man of Gustavo Fring, a prominent figure in the illicit drug trade. He was responsible for various security, logistics, and enforcement aspects within Fring\'s criminal operations.\r\n\r\nInvolvement in Drug Trade:\r\nWhile primarily working for Gustavo Fring, Mike Ehrmantraut had direct involvement in the drug trade. He played a crucial role in ensuring the smooth operation of Fring\'s methamphetamine production and distribution network, including handling disputes and eliminating threats.\r\n\r\nMoney Laundering:\r\nMike Ehrmantraut participated in money laundering activities associated with the criminal enterprises he was involved in. He assisted in hiding the origins of illicit funds, helping to create complex financial networks and structures to legitimize the proceeds of illegal activities.\r\n\r\nSurveillance and Investigation:\r\nPrior to his criminal involvement, Mike Ehrmantraut worked as a private investigator with exceptional skills in surveillance, investigation, and gathering information. These skills proved valuable in his criminal endeavors, aiding in intelligence gathering and protecting the interests of his criminal associates.\r\n\r\nKNOWN ASSOCIATES:\r\n\r\nGustavo Fring:\r\nMike Ehrmantraut formed a close working relationship with Gustavo Fring, acting as his loyal enforcer and confidant. He carried out Fring\'s orders and provided crucial support to ensure the success and security of Fring\'s criminal operations.\r\n\r\nSaul Goodman:\r\nMike Ehrmantraut occasionally interacted with Saul Goodman, a criminal lawyer known for his unorthodox tactics. Saul served as a legal advisor and representative for the criminal associates of Mike and Gustavo Fring, providing assistance in navigating legal matters.\r\n\r\nLEGAL TROUBLES:\r\n\r\nMike Ehrmantraut\'s criminal activities allowed him to operate discreetly and largely avoid significant legal repercussions. His knowledge of law enforcement procedures and ability to operate covertly made it difficult for authorities to build a strong case against him.\r\n\r\nCONCLUSION:\r\n\r\nMike Ehrmantraut, a former police officer turned private investigator and enforcer, became a crucial figure in the criminal operations of Gustavo Fring. His skills in security, logistics, and enforcement, combined with his background in surveillance and investigation, made him an invaluable asset in the criminal underworld.'),(4,'INTERPOL DOSSIER\r\n\r\nSUBJECT: Jesse Pinkman\r\n\r\nPERSONAL INFORMATION:\r\n\r\nFull Name: Jesse Bruce Pinkman\r\nAlias: Cap\'n Cook\r\nDate of Birth: September 24, 1984\r\nPlace of Birth: Albuquerque, New Mexico, USA\r\nNationality: American\r\n\r\nPHYSICAL DESCRIPTION:\r\n\r\nHeight: 5\'9\" (175 cm)\r\nBuild: Slim\r\nHair Color: Brown (often dyed or styled differently)\r\nEye Color: Blue\r\n\r\nBACKGROUND:\r\n\r\nJesse Pinkman was a former student and small-time methamphetamine producer who became involved in the drug trade under the influence of Walter White, a high school chemistry teacher turned drug lord. Jesse\'s troubled background and struggles with addiction shaped his path into the criminal underworld.\r\n\r\nCRIMINAL ACTIVITIES:\r\n\r\nMethamphetamine Production and Distribution:\r\nJesse Pinkman was actively involved in the production and distribution of methamphetamine. He initially operated as a small-scale producer, known for his unique blue methamphetamine product, before entering into larger operations alongside Walter White.\r\n\r\nDrug Trafficking:\r\nAs his involvement in the drug trade expanded, Jesse Pinkman played a significant role in the distribution of methamphetamine. He established connections with various criminal networks and participated in the transportation and sale of illicit drugs.\r\n\r\nViolence and Criminal Associations:\r\nJesse Pinkman was frequently associated with violence and criminal elements. His involvement in the drug trade led to conflicts with rival dealers, resulting in confrontations, physical altercations, and occasional acts of retaliation.\r\n\r\nMoney Laundering:\r\nWhile primarily focused on drug production and distribution, Jesse Pinkman participated in money laundering activities. He assisted in concealing the proceeds from drug sales, utilizing various methods to legitimize and integrate illegal funds into the legitimate economy.\r\n\r\nKNOWN ASSOCIATES:\r\n\r\nWalter White:\r\nJesse Pinkman entered into a partnership with Walter White, initially as his chemistry teacher turned mentor and eventually as a business partner in the methamphetamine trade. Their relationship evolved from a teacher-student dynamic to a complex partnership marred by conflicts and personal struggles.\r\n\r\nSaul Goodman:\r\nJesse Pinkman occasionally interacted with Saul Goodman, a criminal lawyer known for his unorthodox methods. Saul provided legal advice and assistance to Jesse, primarily in matters related to the drug trade and navigating the legal consequences of criminal activities.\r\n\r\nLEGAL TROUBLES:\r\n\r\nJesse Pinkman faced numerous legal troubles throughout his involvement in the drug trade. He was subject to law enforcement investigations, arrests, and charges related to drug production, distribution, and violence. However, his status as a valuable asset to higher-profile criminals often led to reduced consequences or opportunities for leniency.\r\n\r\nCONCLUSION:\r\n\r\nJesse Pinkman, a former student turned methamphetamine producer and distributor, became deeply entrenched in the criminal underworld. His struggles with addiction, personal conflicts, and involvement in violent activities highlight the devastating consequences of his association with the drug trade.'),(5,'INTERPOL DOSSIER\r\n\r\nSUBJECT: Saul Goodman\r\n\r\nPERSONAL INFORMATION:\r\n\r\nFull Name: James Morgan McGill\r\nAlias: Saul Goodman\r\nDate of Birth: November 12, 1962\r\nPlace of Birth: Unknown\r\nNationality: American\r\n\r\nPHYSICAL DESCRIPTION:\r\n\r\nHeight: 5\'7\" (170 cm)\r\nBuild: Average\r\nHair Color: Black (sometimes with hairpieces)\r\nEye Color: Brown\r\n\r\nBACKGROUND:\r\n\r\nSaul Goodman, whose real name is James Morgan McGill, is a criminal lawyer known for his dubious ethics and colorful personality. His true background and personal history remain largely undisclosed. Saul operates under the alias \"Saul Goodman\" and has gained a reputation as a flamboyant, fast-talking attorney catering to criminal clientele.\r\n\r\nCRIMINAL ASSOCIATIONS:\r\n\r\nSaul Goodman has had affiliations with numerous criminal clients and organizations involved in illicit activities. He has represented individuals engaged in drug trafficking, money laundering, fraud, and various other criminal enterprises. Saul\'s services primarily involve providing legal advice and devising strategies to navigate the legal system and protect his clients\' interests.\r\n\r\nMODUS OPERANDI:\r\n\r\nLegal Representation:\r\nSaul Goodman uses his legal expertise to represent criminal clients, often offering creative and unorthodox solutions to their legal troubles. He specializes in exploiting legal loopholes, bending the rules, and negotiating deals that benefit his clients, sometimes at the expense of ethical considerations.\r\n\r\nMoney Laundering:\r\nIn addition to his legal practice, Saul has been involved in money laundering activities. He provides guidance to clients seeking to conceal the origins of illicit funds, using his knowledge of financial systems and legal structures to create complex networks for money laundering purposes.\r\n\r\nKNOWN ASSOCIATES:\r\n\r\nWalter White:\r\nSaul Goodman developed a working relationship with Walter White, a high school chemistry teacher turned methamphetamine manufacturer. Saul played a critical role in facilitating Walter\'s criminal activities, providing legal counsel and assisting with money laundering efforts.\r\n\r\nJesse Pinkman:\r\nSaul also had dealings with Jesse Pinkman, a small-time methamphetamine producer and associate of Walter White. He often served as a mediator between Jesse and Walter, helping resolve disputes and offering advice on navigating the criminal underworld.\r\n\r\nLEGAL TROUBLES:\r\n\r\nSaul Goodman has faced several legal investigations and disciplinary actions related to his conduct as an attorney. His questionable ethics and associations with criminals have raised suspicions among law enforcement agencies, but concrete evidence linking him directly to criminal activities has been elusive.\r\n\r\nCONCLUSION:\r\n\r\nSaul Goodman, also known as James Morgan McGill, is a criminal lawyer who caters to a clientele engaged in various illegal activities. He operates with a flamboyant personality and employs unorthodox legal tactics to serve his clients\' interests. While he has managed to avoid significant legal consequences, his associations with criminal elements and ethically dubious practices make him a person of interest in ongoing investigations.');
